import React from "react";
import './Stil.css';

import {Row} from "react-router-dom";



class Home extends React.Component {
  render() {
    return (
      <div className="main-div">
       <Row><img src="proba.jpg/171x180" rounded /> </Row>
        <div className="table-responsive" id="tabelica-div">
            <table className="table table-hover" id="tabelica">
              <thead>
                <tr>
                  <th scope="col">Šejla Pljakić</th>
                </tr>
              </thead>
            </table>
            <br />
          </div>
          <br />
          <p id="info"> <p> Inspiring, a mission-driven enthusiast who can help you to create or adapt customized applications with reusable and maintainable components for clients or other organizations. </p>
<p>  A proactive contributor who listens to clients needs and works with engineering and programming skills to analyze, define, design and implement complex, distributed software systems to meet those needs.   </p>         
<p> ▪ A passionate innovator and problem solver who helps others to be unique and to use their full potential and to get customer trust. </p>  
 <a href="/about-me" style={{color: "rgb(56, 204, 192)"}}>click here.</a>
          </p>
          <br />
          <button type="button" id="dugmic" className="btn btn-outline-secondary">Download my CV</button>
      </div>
    );
  }
}

export default Home;
